BEGIN TRANSACTION;
CREATE TABLE "ferry-lines" (
    "id"         INTEGER PRIMARY KEY NOT NULL,
    "line-name"  TEXT,
    "shape-data" BLOB
);
CREATE TABLE "ferry-terminals" (
    "id"            INTEGER PRIMARY KEY NOT NULL,
    "terminal-name" TEXT,
    "shape-data"    BLOB
);
CREATE TABLE "terminals-lines" (
    "terminal-id"   INTEGER NOT NULL,
    "terminal-name" TEXT,
    "has-line"      TEXT,
    "line-id"       INTEGER
);
CREATE TABLE "transportation-load" (
    "day"          INTEGER,
    "month"        INTEGER,
    "year"         INTEGER,
    "hour"         INTEGER,
    "n-passengers" INTEGER
);
CREATE TABLE "trips-per-ferry-line" (
    "year"      INTEGER,
    "line-name" TEXT PRIMARY KEY NOT NULL,
    "n-trips"   INTEGER
);
CREATE TABLE "weather-observations" (
    "day"          INTEGER,
    "month"        INTEGER,
    "year"         INTEGER,
    "hour"         INTEGER,
    "avg-temp"     REAL,
    "avg-humidity" REAL,
    "avg-precip"   REAL,
    "avg-wind"     REAL,
    "avg-winddir"  REAL
);
CREATE TABLE "weather-sensors" (
    "id"          INTEGER PRIMARY KEY NOT NULL,
    "sensor-name" TEXT,
    "shape-data"  BLOB
);
COMMIT;
